public JSONObject getShareRestrictByShareType(String relateid, String shareType) {
    if (VirtualDatabaseUtil.hasRMIRequest(SocialContactShareService.class.getSimpleName(), "getShareRestrictByShareType")) {
        this.assertLinkShareAccessible(relateid, PurviewType.READ);
    }

    if (StringUtil.isNotNullAndEmpty(shareType) && shareType.equals("WECHAT")) {
        JSONObject result = new JSONObject();
        ShareRecord shareRecord = SocialContactShareDAOFactory.getShareRecordDAO().loadWeChatByRelateid(relateid);
        if (null == shareRecord) {
            return result;
        } else {
            try {
                if (shareRecord.getEnabled() && !StringUtil.isNullOrEmpty(shareRecord.getCode())) {
                    result.put("result", true);
                    if (null != shareRecord.getEnddate()) {
                        result.put("sharedate", DateUtil.getDateToString(shareRecord.getEnddate()));
                    } else {
                        result.put("sharedate", "");
                    }

                    result.put("sharecode", AESCryption.decrypt(shareRecord.getCode()));
                } else {
                    result.put("result", false);
                }
            } catch (ParseException var6) {
                result.put("result", false);
            }

            return result;
        }
    } else {
        return this.shareRestrict(relateid, (String)null, (String)null, (String)null);
    }
}

